import htmlIcon from '../../assets/html5.png';
import cssIcon from '../../assets/css3.png';
import jsIcon from '../../assets/js.png';
import reactIcon from '../../assets/react.png';
import tailwindIcon from '../../assets/tailwind.png';
import dartIcon from '../../assets/dart.png';
import flutterIcon from '../../assets/flutter.png';
import firbaseIcon from '../../assets/firebase.png';

const technoList = [
  {
    index: '1',
    imageUrl: htmlIcon,
    imageAlt: 'html logo',
  },
  {
    index: '2',
    imageUrl: cssIcon,
    imageAlt: 'css logo',
  },
  {
    index: '3',
    imageUrl: jsIcon,
    imageAlt: 'js logo',
  },
  {
    index: '4',
    imageUrl: reactIcon,
    imageAlt: 'react logo',
  },
  {
    index: '5',
    imageUrl: tailwindIcon,
    imageAlt: 'tailwind logo',
  },
  {
    index: '6',
    imageUrl: dartIcon,
    imageAlt: 'dart logo',
  },
  {
    index: '7',
    imageUrl: flutterIcon,
    imageAlt: 'flutter logo',
  },
  {
    index: '8',
    imageUrl: firbaseIcon,
    imageAlt: 'firebase logo',
  },
];

export default technoList;
